import React from 'react';
import Quadrant from './Quadrant';

const Options = () => (
  <div className="options-container">
    <Quadrant title="Soundscape" options={["Music", "Nature", "Rain", "Celestial", "Beach", "Chimes", "Storm", "White Noise"]} />
    <Quadrant title="Language" options={["English", "Español", "Deutsch", "Français", "Italiano", "Português", "Polski", "Русский"]} />
    <Quadrant title="Duration" options={["5", "10", "15", "20", "30", "45", "60", "∞"]} />
    <Quadrant title="Voice" options={["Willow", "Atlas", "Daniel", "Ester"]} />
  </div>
);

export default Options;
